import React from "react";

function Product() {
  return (
    <div className="container">
      <div className="row">
        <div className="img-container">
          <img src="/items/project1.jpg" alt="product" />
        </div>
        <div className="content"></div>
      </div>
    </div>
  );
}

export default Product;
